window.bookSummaryJSON = "<p>Tim's plan didn't include going toe to toe with one of the most powerful men in Promethia, but he had, and he won. </p> <p>Wasn't winning supposed to make things easier? </p> <p>Instead of getting to live on easy street, Tim's victory only increased his reputation as a man who could solve problems. </p> <p>This time those problems had teeth.</p> <p>Thankfully Tim hit level 10, and once he settled on his upgraded class their newest adventure could began in earnest. </p> <p>Life in The Etheric Coast wasn't exactly what he expected, it was better. With new adventures and epic loot on the horizon, Tim was never more excited to see where his next quest would take him. </p> <p>It was time for Tim to start his next adventure, and there was only one way to attack the unknown. \"LeeeeeRoyyyyyyy!\"</p>"; 
